public class InnerDataSourceWebDataSourceConfigurationFactory(Action<Humidifier.Bedrock.DataSourceTypes.WebDataSourceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Bedrock.DataSourceTypes.WebDataSourceConfiguration>
{

    internal InnerDataSourceWebSourceConfigurationFactory SourceConfigurationFactory { get; set; }

    internal InnerDataSourceWebCrawlerConfigurationFactory CrawlerConfigurationFactory { get; set; }

    protected override Humidifier.Bedrock.DataSourceTypes.WebDataSourceConfiguration Create()
    {
        var webDataSourceConfigurationResult = CreateWebDataSourceConfiguration();
        factoryAction?.Invoke(webDataSourceConfigurationResult);

        return webDataSourceConfigurationResult;
    }

    private Humidifier.Bedrock.DataSourceTypes.WebDataSourceConfiguration CreateWebDataSourceConfiguration()
    {
        var webDataSourceConfigurationResult = new Humidifier.Bedrock.DataSourceTypes.WebDataSourceConfiguration();

        return webDataSourceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Bedrock.DataSourceTypes.WebDataSourceConfiguration result)
    {
        base.CreateChildren(result);

        result.SourceConfiguration ??= SourceConfigurationFactory?.Build();
        result.CrawlerConfiguration ??= CrawlerConfigurationFactory?.Build();
    }

} // End Of Class

